export default class APIGetURL{
    // Insert an article
    static InsertArticle(body){
        return fetch(`/add`,{
            'method':'POST',
             headers : {
            'Content-Type':'application/json'
      },
      body:JSON.stringify(body)
    })
    .then(response => response.json())
    .catch(error => console.log(error))
    }
}
